import React, { FC, useEffect, useState } from 'react'
import '../../styles/Shop/DropDownMenu.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCheck } from '@fortawesome/free-solid-svg-icons'

interface DropDownMenuProps {
    typeOfFilter: string
    handleSortByFilter: Function,
    sortByFilterOption: string,
    handleCategoryFilter: Function,
    categoryFilterOption: string,
}

const DropDownMenu: FC<DropDownMenuProps> = ({ typeOfFilter, handleSortByFilter, sortByFilterOption, categoryFilterOption,
    handleCategoryFilter }) => {
    const [sortByFilter, SetSortByFilter] = useState(false)
    const [categoryFilter, setCategoryFilter] = useState(false)

    useEffect(() => {
        if (typeOfFilter === 'Sort By') {
            SetSortByFilter(true)
        } else if (typeOfFilter === 'Category') {
            setCategoryFilter(true)
        }
    }, [])

    return (
        <div className={`dropDownMenuWrapper ${sortByFilter ? 'sort-by' : ''}`}>
            <div className={`dropDownMenuContent ${sortByFilter ? 'sort-by' : ''}`}>
                {sortByFilter && (
                    <ul className='sortByOptionsWrapper'>
                        <li className={`sortByOption topRated ${sortByFilterOption === 'Top Rated' ? 'filterOn' : ''}`}
                            onClick={() => handleSortByFilter('Top Rated')}>Top Rated
                            {sortByFilterOption === 'Top Rated' ? <FontAwesomeIcon icon={faCheck} /> : null}</li>
                        <li className={`sortByOption ${sortByFilterOption === 'Low to high' ? 'filterOn' : ''}`}
                            onClick={() => handleSortByFilter('Low to high')}>Price: Low to high
                            {sortByFilterOption === 'Low to high' ? <FontAwesomeIcon icon={faCheck} /> : null}</li>
                        <li className={`sortByOption ${sortByFilterOption === 'High to low' ? 'filterOn' : ''}`}
                            onClick={() => handleSortByFilter('High to low')}>Price: High to low
                            {sortByFilterOption === 'High to low' ? <FontAwesomeIcon icon={faCheck} /> : null}</li>
                    </ul>
                )}
                {categoryFilter && (
                    <ul className='categoryOptionsWrapper'>
                        <li className={`categoryOption all ${categoryFilterOption === 'All' ? 'filterOn' : ''}`}
                            onClick={() => handleCategoryFilter('All')}>
                            <label>
                                <input type="radio" name="all" value="All" />
                                All
                            </label>
                            {categoryFilterOption === 'All' ? <FontAwesomeIcon icon={faCheck} /> : null}</li>
                        <li className={`categoryOption ${categoryFilterOption === 'Men' ? 'filterOn' : ''}`}
                            onClick={() => handleCategoryFilter('Men')}>
                            <label>
                                <input type="radio" name="men" value="Men" />
                                Men
                            </label>
                            {categoryFilterOption === 'Men' ? <FontAwesomeIcon icon={faCheck} /> : null}</li>
                        <li className={`categoryOption ${categoryFilterOption === 'Women' ? 'filterOn' : ''}`}
                            onClick={() => handleCategoryFilter('Women')}>
                            <label>
                                <input type="radio" name="women" value="Women" />
                                Women
                            </label>
                            {categoryFilterOption === 'Women' ? <FontAwesomeIcon icon={faCheck} /> : null}</li>
                        <li className={`categoryOption ${categoryFilterOption === 'Jewelery' ? 'filterOn' : ''}`}
                            onClick={() => handleCategoryFilter('Jewelery')}>
                            <label>
                                <input type="radio" name="jewelery" value="Jewelery" />
                                Jewelery
                            </label>
                            {categoryFilterOption === 'Jewelery' ? <FontAwesomeIcon icon={faCheck} /> : null}</li>
                    </ul>
                )}
            </div>
        </div>
    )
}

export default DropDownMenu
